import React from 'react';
import { HashRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';
import Home from './frontend/pages/Home/Home';
// import JavaScript from './pages/javascript/javascript';
// import ReactPage from './pages/react/react.js';
// import CSS from './pages/css/css.js';
import NotFound from './frontend/Components/Not-Found';
import Navbar from './frontend/Components/Navbar/Navbar';
import Footer from '/Users/vincentman/Desktop/the-cerulean-project/src/frontend/Components/Not-Found/Not-Found.js';

class App extends React.Component {

  render() {
    return (
      <>
        <Router>
          <div className='App'>
            <Navbar />
            <Switch>
              <Route exact path='/' component={Home} />
              <Route exact path='/contact' component={Home} />
              <Route exact path='./Not-Found' component={NotFound}/>
              {/* <Route exact path='/javascript' component={JavaScript} />
                <Route exact path='/react' component={ReactPage} />
                <Route exact path='/css' component={CSS} /> */}
            </Switch>
            <Footer />
          </div>
        </Router>
      </>
    );
  }
}

export default App;
